import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import { BrowserRouter } from "react-router-dom";
import Router from "./Routes"; // Assuming the Router component you defined is in Routes.js

ReactDOM.render(
  <BrowserRouter>
    <App />
    <Router />
  </BrowserRouter>,
  document.getElementById("root")
);
